import React from 'react';

function About() {
  return (
    <div className='container grid place-items-center '>
        <h2 className='capitalize text-bold text-3xl my-3 md:text-4xl md:my-3'>Who's Github Users</h2>
          <div className='text-center text-1xl mb-3 md:text-2xl md:mb-4'>
            <h5>They are a team who build all types of websites.</h5>
          
      
          <p>Whenever you got stuck you can find us</p>

          <p>We are always happy to help &#128516;</p>

          </div>
        <img className='content-center' src={require('../images/happyToHelp.jpg')} alt="" />
    </div>
  )
}




export default About
